import React from 'react'
import Card from './card'
import Carousel from './Carousel';


function ritual() {
  return (
    <div className='flex bg-gold mt-9 justify-center py-2 flex-col'>
        <div className='w-4/5 flex justify-center'>
            <h2 className='text-3xl text-principal font-semibold'>Lecturas</h2>
        </div>
        <div className='w-4/5 mt-10'>
            <Carousel/>
        </div>
    </div>
  )
}

export default ritual
